(if
  (contains? fz-map "EREIGNIS_DATUM")
  (if
    (=
      (get fz-map "EREIGNIS_DATUM")
      ""
    )
    true
    (=
      (:ereignisDatum
        (first 
          (filter 
            #(= 
               (get fz-map "BEZUGS_OBJEKT_TYP_INFO_ZU_EREIGNIS")
               (:bezugsObjTyp %)
            ) fo-ereignisGesamtinfoLesen 
          )
        )
      )
      (get fz-map "EREIGNIS_DATUM")
    )
  )
  true
)

(if (or (nil? maxDatum-clj) (nil? bisDatum-clj)) 
  "31.12.1970" 
  ; Für die Wiedervorlage darf das Max-Datum nicht überschritten werden
  (if (= (compare bisDatum-clj maxDatum-clj) 1) 
    (str (if (> (Integer. (.format (java.text.SimpleDateFormat. "MM")  maxDatum-clj)) 6) "31.12." "30.06.")
	 (.format (java.text.SimpleDateFormat. "yyyy") maxDatum-clj)
    ) 
    (str (if (> (Integer. (.format (java.text.SimpleDateFormat. "MM")   bisDatum-clj)) 6) "31.12." "30.06.")
	 (.format (java.text.SimpleDateFormat. "yyyy") bisDatum-clj)
    )
   )
)

(if (nil? wiedervorlageDatum)
  (.getTime (doto (new java.util.GregorianCalendar) (.set 1975 11 31)))
  (.getTime 
   (doto (new java.util.GregorianCalendar) 
     (.set 
	  (Integer. (subs wiedervorlageDatum 6)) 
	  (dec (Integer. (subs wiedervorlageDatum 3, 5)))
	  (Integer. (subs wiedervorlageDatum 0, 2))
     )
   )
  )
)
